INSERT INTO `pages` (`id`, `page_name`, `page_title`, `page_link`, `meta_title`, `meta_description`, `meta_keywords`, `contents`) VALUES
(2, 'about-us', 'About Us', 'about-us', 'About Us', '', '', '<section>\r\n<div class="container">\r\n<section class="dnd_section_DD  section_with_header">\r\n<div class="dnd_section_content">\r\n<div class="dnd_container">\r\n<div class="dnd_column_DD_span6 ">\r\n<p>Jordana Cosmetics is a family-owned business headquartered in Los Angeles, California. For over 25 years, Jordana&rsquo;s philosophy has been to offer every woman the chance to experience superior quality, fashion forward cosmetics at extremely affordable prices.</p>\r\n<p>Jordana&rsquo;s commitment to high-quality cosmetics has enabled the brand to have broad and global appeal. Jordana has captured the attention and loyalty of millions of women around the world. Today, women of all ages, incomes and ethnicities enjoy the exciting and colorful line making women feel and look beautiful!</p>\r\n<p>Jordana features modern packaging, advanced formulas and trendsetting-shade ranges. Most of our products are still proudly Made in USA. These unique distinctions have earned Jordana unparalleled dedication, complete product satisfaction and the subsequent loyalty of consumers all over the world.</p>\r\n<p>Jordana continues to be the leading brand of value priced cosmetics and after 25 years Jordana remains Beauty&rsquo;s Best Buy!</p>\r\n<p><strong>About Mishka Beauty:</strong></p>\r\n<p>MISHKA Beauty Pakistan is an affiliate partnership of MISHKA Beauty USA and exlcusive distributor/respresentatives of Jordana brand in Pakistan.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n</section>');
